import React from 'react';

const Footer = ({ onContactClick }) => {
  return (
    <footer style={styles.footer}>
      <div className="container" style={styles.grid}>
        <div>
          <h2 style={{ color: '#2ecc71', marginBottom: '20px' }}>Techverge Solutions </h2>
          <p style={{ color: '#666', maxWidth: '300px' }}>Building technology that delivers real impact for startups and enterprises worldwide.</p>
        </div>
        <div>
          <h4 style={{ marginBottom: '20px' }}>Quick Links</h4>
          <ul style={{ listStyle: 'none', color: '#666' }}>
            <li><a href="#home" style={styles.link}>Home</a></li>
            <li><a href="#aboutus" style={styles.link}>About Us</a></li>
            <li><a href="#services" style={styles.link}>Services</a></li>
          </ul>
        </div>
        <div>
          <h4 style={{ marginBottom: '20px' }}>Contact</h4>
          <p style={{ color: '#666' }}>hello@techverge.com</p>
          <button onClick={onContactClick} style={styles.btn}>Contact us</button>
        </div>
      </div>
    </footer>
  );
};

const styles = {
  footer: { padding: '80px 0', background: '#050505', borderTop: '1px solid #111' },
  grid: { display: 'flex', justifyContent: 'space-between', flexWrap: 'wrap', gap: '40px' },
  link: { color: '#666', textDecoration: 'none', display: 'block', marginBottom: '10px' },
  btn: { background: '#2ecc71', border: 'none', padding: '10px 20px', borderRadius: '5px', fontWeight: 'bold', marginTop: '15px', cursor: 'pointer' }
};

export default Footer;
